import "./Button.css";

const Button = () => {
  const name = "Josh Perez";
  const element = <h1>Hello, {name}</h1>;

  function formatName(user) {
    return user.firstName + " " + user.lastNmae;
  }

  const user = {
    firstName: "Harper",
    lastName: "Perez",
  };

  return (
    <div>
      {formatName(user)}
      {element}
      <button className="bordered-button">Click me!</button>
    </div>
  );
};

export default Button;
